тправляемого токена. {br}{br}Кроме того, пользователь может обменять заданный процент от своего количества доступных токенов (например, ½, ¼ и т. д.). {br}{br}Еще одним преимуществом службы обмена Swap.Online является использование одного ключа для всего диапазона токенов ERC-20. {br}Кстати, если вы не заинтересованы в обмене некоторыми токенами, вы можете скрыть их из списка. {br}Используйте Swap.Online в качестве основного обмена для каждого криптовалюты, которую вы держите и экономьте ваше время уже сегодня!"},{"id":"RowWallet276","message":" нода не доступна (Вы не можете совершать транзакции). ","files":["src/front/shared/pages/Wallet/Row/Row.tsx"]},{"id":"RowWallet282","message":"Нет соединения...","files":["src/front/shared/pages/Wallet/Row/Row.tsx"]},{"id":"ErrorNotification151","message":"Ошибка: {error}","files":["src/front/shared/components/notifications/ErrorNotification/ErrorNotification.tsx"]},{"id":"BtcToEthToken222","message":"Создается Bitcoin Script. Пожалуйста подождите, это займет некоторое время"},{"id":"deposit213","message":" и 0.002 ETH на gas fee "},{"id":"deposit165","message":"Для продолжения обмена - скопируйте указанный адрес и пополните баланс на {missingBalance}.","files":["src/front/shared/pages/Swap/UTXOSwap/DepositWindow/DepositWindow.tsx"]},{"id":"deposit297","message":"открыть в эксплоурер","files":["src/front/shared/pages/Swap/UTXOSwap/DepositWindow/DepositWindow.tsx"]},{"id":"deposit177","message":"Этой суммы вам не хватает для обмена: {amount} {tokenName}, сумма указана с учетом комиссии майнеров.{br}Вы можете отправить {tokenName} с любого кошелька или биржи.","files":["src/front/shared/pages/Swap/UTXOSwap/DepositWindow/DepositWindow.tsx"]},{"id":"deposit231","message":"Получено {balance} / {need} {tooltip}"},{"id":"deposit239","message":"Если вы пополните контракт на сумму больше указанной - остаток будет списан в качестве комиссии майнеров.","files":["src/front/shared/pages/Swap/UTXOSwap/DepositWindow/DepositWindow.tsx"]},{"